const router = require("express").Router();
const User = require("../models/users");
//let user = require("../models/users");



//adding users            
//http://localhost:9090/user/add
router.route("/add").post((req, res) => {

    const firstname = req.body.firstname;
    const lastname= req.body.lastname
    const email = req.body.email;
    const phoneNumber = Number(req.body.phoneNumber);
    const password = req.body.password;


    const newuser = new User({
        firstname,
        lastname,
        email,
       phoneNumber,
        password
    })


    //save user and return json
    

    newuser.save().then(() => {
        res.json(newuser._id)
        console.log(newuser._id)
    }).catch((err) => {
        console.log(err);
    })
})


//viewall
router.route("/").get((req, res) => {

   User.find().then((users) => {
        res.json(users)
    }).catch((err) => {
        console.log(err);
    })


})

//update

router.route("/update/:id").put(async(req, res) => {
    let userId = req.params.id;

    const {  name, email, address, phoneNumber, password } = req.body;


    const updateUser = {
        firstname,
        lastname,
        email,
        phoneNumber,
        password
    }
    const update = await User.findByIdAndUpdate(userId, updateUser).then(() => {
        res.status(200).send({ status: "User updated", user: update })
    }).catch((err) => {
        console.log(err);
        res.status(500).send({
            status: "Error with updating Data ",
            error: err.massage
        })

    })


})

